
var fs = require('fs');
var JSONTCPSOCKET = require('../../json-tcp-socket.js');

var JSONTCPSOCKET = new JSONTCPSOCKET({tls: true});
var server = new JSONTCPSOCKET.Server({
    key: fs.readFileSync(__dirname+'/cert/tls.key'),
    cert: fs.readFileSync(__dirname+'/cert/tls.crt')
});

server.on('secureConnection', function (socket) {
    console.log('client connected: ', socket.socket.remoteAddress);

    socket.on('data', function (data) {
        console.log('json:', data.item);
    });

    var a = {item: 'A', a: ''};
    var b = {item: 'B', b: ''};
    var c = {item: 'asdadsadsadsasd87a8ds7ads67ad6sa6dsa', a: 1, b: 2, c: 3, d: 'asda87sd8a78ds7a8ds7a8d7a87ds8a7dsa', d: 'aas8d7a8dsa87ds8a7ds87a8ds7a8d7s8a7ds8a78ds7a8ds7a8ds7a'};
    var d = '{"item": "98989182391829381", "a": "1", "b": "2", "c": "3", "d": "asda87sd8a78ds7a8ds7a8d7a87ds8a7dsa", "d": "asda87sd8a78ds7a8ds7a8d7a87ds8a7dsa"}';
    var e = '{"item": "ee", "a": "1", "d": "643", "d": "123"}';
    var f = '{"item": "dd", "a": "1", "d": "643", "d": "123"}';

    socket.write(a);
    socket.write(a);
    socket.write(a);
    socket.write(b);

    setInterval(function () {
        socket.write(e);
    }, 1000);

    setInterval(function () {
        socket.write(f);
    }, 1500);

    socket.write(d);
    socket.write(c);
    socket.write(b);
    socket.write(b);
});

server.listen(5055, '0.0.0.0');

console.log('Server listening 0.0.0.0:5055 over TLS');